// src/components/Home.js
import React from 'react';
import { Link } from 'react-router-dom';
import Img from '../components/img';
const Home = () => {
  return (
    <div>
      <Img/>
        <div className="container">
        <div className="row">
          <div className="col-md-6 col-lg-4">
            <h2>Columna 1</h2>
            <p>Este es contenido en la primera columna.</p>
          </div>
          <div className="col-md-6 col-lg-4">
            <h2>Columna 2</h2>
            <p>Este es contenido en la segunda columna.</p>
          </div>
          <div className="col-md-6 col-lg-4">
            <h2>Columna 3</h2>
            <p>Este es contenido en la tercera columna.</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
